import React from "react";
import { useNavigate } from "react-router-dom";

const Dashboard = () => {
  const navigate = useNavigate();

  const handleLogout = () => {
    localStorage.removeItem("token");
    navigate("/login");
  };

  return (
    <div className="dashboard-wrapper">
      {/* Full View Power BI Dashboard */}
      <div className="dashboard-container">
        <iframe
          title="Power BI Dashboard"
          className="dashboard-frame"
          src="https://app.powerbi.com/reportEmbed?reportId=ec54a816-3afc-4035-bd7e-a129f30ae980&autoAuth=true&ctid=ff335ba2-bb68-489a-bbdd-f49ab4319838"
          frameBorder="0"
          allowFullScreen={true}
        ></iframe>
      </div>

      {/* Scrollable Content */}
      <div className="extra-content">
        {/* Logout Button at Bottom */}
        <button className="logout-button" onClick={handleLogout}>Logout</button>

        {/* About Developer Section */}
        <div className="about-developer">
          <h3>About the Developer</h3>
          <p>Developed by <strong>Shaik Mohammad Mujahiddin</strong>, a passionate software engineer focused on AI, ML, and full-stack development. ðŸš€</p>
          <p>Connect on <a href="https://www.linkedin.com/in/your-profile" target="_blank" rel="noopener noreferrer">LinkedIn</a> or view projects on <a href="https://github.com/your-github" target="_blank" rel="noopener noreferrer">GitHub</a>.</p>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
